class Solution(object):
    def maxProduct(self, nums):
        max = nums[0]
        length = len(nums)
        results = [[1 for col in range(length)] for row in range(length)] #array('l', (length, length), dtype='int32')
        i = 1
        while i <= len(nums):
            for j in range(length - i + 1):
                start = j
                end = j + i - 1
                results[start][end] = results[start][end - 1] * nums[end]
                if results[start][end] > max:
                    max = results[start][end]
            i += 1
        return max
    def maxProduct2(self, nums):
        length = len(nums)
        curMax = nums[0]
        curMin = nums[0]
        gloMax = nums[0]
        i = 1
        while i < length:
            tempMax = curMax * nums[i]
            tempMin = curMin * nums[i]
            curMax = max([nums[i], tempMax, tempMin])
            curMin = min([nums[i], tempMax, tempMin])
            gloMax = max(gloMax, curMax)
            i += 1
        return gloMax

